"use strict";document.querySelectorAll(".read-bio-container").forEach(function(e){e.addEventListener("click",function(e){console.log("clicked");var t=e.target.parentNode.parentNode.parentNode;t.classList.contains("read-bio-active")?t.classList.remove("read-bio-active"):t.classList.add("read-bio-active")})});var toggleClassName="contact-active";document.querySelectorAll(".contact-container").forEach(function(e){e.addEventListener("click",function(e){console.log("contact container clicked"),e.target.parentNode.parentNode.classList.add(toggleClassName)})}),document.querySelectorAll(".close-contact-info").forEach(function(e){e.addEventListener("click",function(e){console.log("close");var t=e.target.closest(".staff");console.log(t),t.classList.remove(toggleClassName)})});